import React from "react";
import "./App.css";
import ListItem from "./SimpleComponents/ListItem";
import moment from "moment";
import NavBar from "./SimpleComponents/NavBar";
import cover01 from "./Images/cover001.jpg";
import cover02 from "./Images/cover002.jpg";
import cover03 from "./Images/cover003.jpg";
import user01 from "./Images/user001.jpg";
import user02 from "./Images/user002.jpg";
import user03 from "./Images/user003.jpg";
import user04 from "./Images/user004.jpg";
// import Flyer from "./SimpleComponents/Flyer";

function App() {
  const nameList = [
    {
      id: 1,
      name: {
        title: "Mr",
        first: "Bat",
        last: "Man",
      },
      location: {
        city: "Ghotham",
      },
      email: "bat.man@example.com",
      dob: {
        date: "1973-07-20T09:44:18.674Z",
      },
      picture: {
        medium: "https://randomuser.me/api/portraits/med/men/72.jpg",
      },
    },

    {
      id: 2,
      name: {
        title: "Mr",
        first: "Super",
        last: "Man",
      },
      location: {
        city: "New York",
      },
      email: "super.man@example.com",
      dob: {
        date: "1890-08-23T01:14:28.374Z",
      },
      picture: {
        medium: "/Images/user002.jpg",
      },
    },

    {
      id: 3,
      name: {
        title: "Mr",
        first: "Aqua",
        last: "Man",
      },
      location: {
        city: "Colombo",
      },
      email: "aqua.man@example.com",
      dob: {
        date: "1977-12-22T01:14:28.374Z",
      },
      picture: {
        medium: { user03 },
      },
    },

    {
      id: 4,
      name: {
        title: "Miss",
        first: "Wonder",
        last: "Woman",
      },
      location: {
        city: "Miami",
      },
      email: "wonder.woman@example.com",
      dob: {
        date: "1898-01-01T09:44:18.674Z",
      },
      picture: {
        medium: { user04 },
      },
    },
  ];

  const nameListComponent = () => {
    return nameList.map((card) => {
      return (
        <ListItem
          key={card.id}
          name={`${card.name.title} ${card.name.first} ${card.name.last}`}
          city={card.location.city}
          email={card.email}
          birthday={moment(card.dob.date).format("L")}
          avatar={card.picture.medium}
          avatar={window.location.origin + card.picture.medium}
        />
      );
    });
  };

  return (
    <React.Fragment>
      <div className="PageColor">
        <NavBar />
        <div
          id="carouselExampleIndicators"
          className="carousel slide"
          data-ride="carousel"
        >
          <ol className="carousel-indicators">
            <li
              data-target="#carouselExampleIndicators"
              data-slide-to="0"
              className="active"
            ></li>
            <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
            <li data-target="#carouselExampleIndicators" data-slide-to="2"></li>
          </ol>
          <div className="carousel-inner">
            <div className="carousel-item active">
              <img src={cover01} className="d-block w-100" alt="..." />
            </div>
            <div className="carousel-item">
              <img src={cover02} className="d-block w-100" alt="..." />
            </div>
            <div className="carousel-item">
              <img src={cover03} className="d-block w-100" alt="..." />
            </div>
          </div>
          <a
            className="carousel-control-prev"
            href="#carouselExampleIndicators"
            role="button"
            data-slide="prev"
          >
            <span
              className="carousel-control-prev-icon"
              aria-hidden="true"
            ></span>
            <span className="sr-only">Previous</span>
          </a>
          <a
            className="carousel-control-next"
            href="#carouselExampleIndicators"
            role="button"
            data-slide="next"
          >
            <span
              className="carousel-control-next-icon"
              aria-hidden="true"
            ></span>
            <span className="sr-only">Next</span>
          </a>
        </div>
        <div className="Container">
          <div className="Page">{nameListComponent()}</div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default App;
